import math
import torch
import logging
logger = logging.getLogger(__name__)
try:
    import fast_hadamard_transform
except Exception:
    logger.info(
        'fast_hadamard_transform not installed.'
        'If you need it, please install it firstly.'
    )


# from .module_utils import RotateLinear
# Adapted from
# https://github.com/Cornell-RelaxML/quip-sharp/blob/main/lib/utils/matmul_had.py

def get_hadK(n, transpose=False):
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert is_pow2(n // 172)
        K = 172
        hadK = get_had172().T if transpose else get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert is_pow2(n // 156)
        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 144 == 0:  # pixart/opensora hidden: 4608
        assert is_pow2(n//144)
        K = 144
        hadK = get_had144().T if transpose else get_had144()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert is_pow2(n // 140)
        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert is_pow2(n // 108)
        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert is_pow2(n // 60)
        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert is_pow2(n // 52)
        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert is_pow2(n // 36)
        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:  # llama-3 up
        assert is_pow2(n // 28)
        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 40 == 0:
        assert is_pow2(n // 40)
        K = 40
        hadK = get_had40().T if transpose else get_had40()
    elif n % 20 == 0:
        assert is_pow2(n // 20)
        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert is_pow2(n // 12)
        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert is_pow2(n)
        K = 1

    return hadK, K



def matmul_hadU(X, transpose=False):
    n = X.shape[-1]
    hadK, K = get_hadK(n, transpose)
    input = X.clone().view(-1, n, 1)
    output = input.clone()
    while input.shape[1] > K:
        input = input.view(input.shape[0], input.shape[1] // 2, 2, input.shape[2])
        output = output.view(input.shape)
        output[:, :, 0, :] = input[:, :, 0, :] + input[:, :, 1, :]
        output[:, :, 1, :] = input[:, :, 0, :] - input[:, :, 1, :]
        output = output.view(input.shape[0], input.shape[1], -1)
        (input, output) = (output, input)
    del output

    if K > 1:
        # Do not explicitly repeat - OOM
        # input = torch.bmm(
        #     hadK.repeat(len(input), 1, 1).to(input.device).to(input.dtype), input)
        # Use bcast instead
        input = hadK.view(1, K, K).to(input) @ input

    return input.view(X.shape) / torch.tensor(n).sqrt()


def matmul_hadUt(X):
    return matmul_hadU(X, transpose=True)


def ensure_power_of_two(x):
    """将输入张量的最后一维填充至最近的2的幂次方"""
    n = x.shape[-2]  # 假设特征维度在倒数第二维（如[9,9,1]中的9）
    next_power = 1 << (n - 1).bit_length()  # 计算最近的2的幂次方
    if n != next_power:
        # 填充至next_power（使用0填充）
        pad = next_power - n
        x = F.pad(x, (0, 0, 0, pad))  # 仅填充特征维度
    return x

# 随机初始化一个 hadmard矩阵
def random_hadamard_matrix(size, device):
    # See https://cornell-relaxml.github.io/quip-sharp/,这段代码来自 QUIP-Sharp，随机 Hadamard 变换
    # Section "Randomized Hadamard Transformation"
    # 生成一个 [low,high)，生成 size 个随机数
    Q = torch.randint(low=0, high=2, size=(size,)).to(torch.float64)
    # 0/1 转换为 -1/+1
    Q = Q * 2 - 1
    # 转化为对角矩阵
    Q = torch.diag(Q)
    # Q = ensure_power_of_two(Q)
    return matmul_hadU(Q).to(device)


def matmul_hadU_cuda(X, hadK, K):
    n = X.shape[-1]
    if K == 1:
        return fast_hadamard_transform.hadamard_transform(
            X.contiguous(), 1.0 / torch.tensor(n).sqrt()
        )
    # if transpose:
    #     hadK = hadK.T.contiguous()
    input = X.view(-1, K, n // K)
    input = fast_hadamard_transform.hadamard_transform(
        input.contiguous(), 1.0 / torch.tensor(n).sqrt()
    )
    input = hadK.to(input.device).to(input.dtype) @ input
    return input.reshape(X.shape)


def matmul_hadUt_cuda(X, hadK, K):
    return matmul_hadU_cuda(X, hadK, K, transpose=True)


def apply_exact_had_to_linear(module, had_dim=-1, output=False):
    # assert isinstance(module, (torch.nn.Linear, RotateLinear))
    in_features, out_features = module.in_features, module.out_features

    if had_dim != -1:
        assert is_pow2(had_dim), 'Hadamard dimension must be a power of 2!'

    W_ = module.weight.data
    dtype = W_.dtype
    dev = W_.device
    # init_shape = W_.shape
    W_ = W_.float().cuda()

    if had_dim == -1:
        if output:
            had_K, K = get_hadK(out_features)
            W_ = matmul_hadU_cuda(W_.t(), had_K, K).t()
        if not output:
            had_K, K = get_hadK(in_features)
            W_ = matmul_hadU_cuda(W_, had_K, K)
    else:
        # Apply Hadamard to the last had_dim chunks of the weights
        if output:
            W_ = W_.t()
            transposed_shape = W_.shape
            W_ = (
                fast_hadamard_transform.hadamard_transform(
                    W_.reshape(-1, transposed_shape[-1] // had_dim, had_dim),
                    scale=1 / math.sqrt(had_dim),
                )
                .reshape(transposed_shape)
                .t()
            )
        else:
            raise NotImplementedError('Not implemented (or tested) yet!')
            # n = W_.shape[1]
            # W_ = hadamard_transform(
            #     W_.reshape(-1, n // had_dim, had_dim), scale=1 / math.sqrt(had_dim)
            # ).reshape(init_shape)
    module.weight.data = W_.to(device=dev, dtype=dtype)


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


def get_had144():
    d = torch.load('./hadamard_utils/hadamard_mat.pth', weights_only=True)
    x = d['had.144.tpal']
    return x

